"100031":{"id":"100031","x":"0","y":"37622","shape":"box","label":"require('./Activator.css');\n\n\n\nvar keycharm = require('keycharm');\n\nvar Emitter = require('component-emitter');\n\nvar Hammer = require('../module/hammer');\n\nvar util = require('vis-util');\n\n\n","font":{"align":"left","size":14}},
"100032":{"id":"100032","x":"0","y":"38628","shape":"box","label":"/**\n\n * Turn an element into an clickToUse element.\n\n * When not active, the element has a transparent overlay. When the overlay is\n\n * clicked, the mode is changed to active.\n\n * When active, the element is displayed with a blue border around it, and\n\n * the interactive contents of the element can be used. When clicked outside\n\n * the element, the elements mode is changed to inactive.\n\n * @param {Element} container\n\n * @constructor Activator\n\n */\n\nfunction Activator(container) {\n\n  this.active = false;\n\n\n\n  this.dom = {\n\n    container: container\n\n  };\n\n\n\n  this.dom.overlay = document.createElement('div');\n\n  this.dom.overlay.className = 'vis-overlay';\n\n\n\n  this.dom.container.appendChild(this.dom.overlay);\n\n\n\n  this.hammer = Hammer(this.dom.overlay);\n\n  this.hammer.on('tap', this._onTapOverlay.bind(this));\n\n\n\n  // block all touch events (except tap)\n\n  var events = [\n\n    'tap', 'doubletap', 'press',\n\n    'pinch',\n\n    'pan', 'panstart', 'panmove', 'panend'\n\n  ];\n\n  events.forEach((event) => {\n\n    this.hammer.on(event, (event) => {\n\n      event.srcEvent.stopPropagation();\n\n    });\n\n  });\n\n\n\n  // attach a click event to the window, in order to deactivate when clicking outside the timeline\n\n  if (document && document.body) {\n\n    this.onClick = (event) => {\n\n      if (!_hasParent(event.target, container)) {\n\n        this.deactivate();\n\n      }\n\n    };\n\n    document.body.addEventListener('click', this.onClick);\n\n  }\n\n\n\n  if (this.keycharm !== undefined) {\n\n    this.keycharm.destroy();\n\n  }\n\n  this.keycharm = keycharm();\n\n\n\n  // keycharm listener only bounded when active)\n\n  this.escListener = this.deactivate.bind(this);\n\n}\n\n\n\n// turn into an event emitter\n\nEmitter(Activator.prototype);\n\n\n\n// The currently active activator\n\nActivator.current = null;\n\n\n","font":{"align":"left","size":14}},
"100033":{"id":"100033","x":"0","y":"39872","shape":"box","label":"/**\n\n * Destroy the activator. Cleans up all created DOM and event listeners\n\n */\n\nActivator.prototype.destroy = function () {\n\n  this.deactivate();\n\n\n\n  // remove dom\n\n  this.dom.overlay.parentNode.removeChild(this.dom.overlay);\n\n\n\n  // remove global event listener\n\n  if (this.onClick) {\n\n    document.body.removeEventListener('click', this.onClick);\n\n  }\n\n  // remove keycharm\n\n  if (this.keycharm !== undefined) {\n\n    this.keycharm.destroy();\n\n  }\n\n  this.keycharm = null;\n\n  // cleanup hammer instances\n\n  this.hammer.destroy();\n\n  this.hammer = null;\n\n  // FIXME: cleaning up hammer instances doesn't work (Timeline not removed from memory)\n\n};\n\n\n","font":{"align":"left","size":14}},
"100034":{"id":"100034","x":"0","y":"40570","shape":"box","label":"/**\n\n * Activate the element\n\n * Overlay is hidden, element is decorated with a blue shadow border\n\n */\n\nActivator.prototype.activate = function () {\n\n  // we allow only one active activator at a time\n\n  if (Activator.current) {\n\n    Activator.current.deactivate();\n\n  }\n\n  Activator.current = this;\n\n\n\n  this.active = true;\n\n  this.dom.overlay.style.display = 'none';\n\n  util.addClassName(this.dom.container, 'vis-active');\n\n\n\n  this.emit('change');\n\n  this.emit('activate');\n\n\n\n  // ugly hack: bind ESC after emitting the events, as the Network rebinds all\n\n  // keyboard events on a 'change' event\n\n  this.keycharm.bind('esc', this.escListener);\n\n};\n\n\n","font":{"align":"left","size":14}},
"100035":{"id":"100035","x":"0","y":"41128","shape":"box","label":"/**\n\n * Deactivate the element\n\n * Overlay is displayed on top of the element\n\n */\n\nActivator.prototype.deactivate = function () {\n\n  this.active = false;\n\n  this.dom.overlay.style.display = 'block';\n\n  util.removeClassName(this.dom.container, 'vis-active');\n\n  this.keycharm.unbind('esc', this.escListener);\n\n\n\n  this.emit('change');\n\n  this.emit('deactivate');\n\n};\n\n\n","font":{"align":"left","size":14}},
"100036":{"id":"100036","x":"0","y":"41518","shape":"box","label":"/**\n\n * Handle a tap event: activate the container\n\n * @param {Event}  event   The event\n\n * @private\n\n */\n\nActivator.prototype._onTapOverlay = function (event) {\n\n  // activate the container\n\n  this.activate();\n\n  event.srcEvent.stopPropagation();\n\n};\n\n\n","font":{"align":"left","size":14}},
"100037":{"id":"100037","x":"0","y":"41992","shape":"box","label":"/**\n\n * Test whether the element has the requested parent element somewhere in\n\n * its chain of parent nodes.\n\n * @param {HTMLElement} element\n\n * @param {HTMLElement} parent\n\n * @returns {boolean} Returns true when the parent is found somewhere in the\n\n *                    chain of parent nodes.\n\n * @private\n\n */\n\nfunction _hasParent(element, parent) {\n\n  while (element) {\n\n    if (element === parent) {\n\n      return true\n\n    }\n\n    element = element.parentNode;\n\n  }\n\n  return false;\n\n}\n\n\n\nmodule.exports = Activator;\n","font":{"align":"left","size":14}},
