"100080":{"id":"100080","x":"0","y":"79504","shape":"box","label":"/**\n\n * Popup is a class to create a popup window with some text\n\n */\n\nclass Popup {\n","font":{"align":"left","size":14}},
"100081":{"id":"100081","x":"0","y":"79866","shape":"box","label":"  /**\n\n   * @param {Element} container       The container object.\n\n   * @param {string}  overflowMethod  How the popup should act to overflowing ('flip' or 'cap')\n\n   */\n\n  constructor(container, overflowMethod) {\n\n    this.container = container;\n\n    this.overflowMethod = overflowMethod || 'cap';\n\n\n\n    this.x = 0;\n\n    this.y = 0;\n\n    this.padding = 5;\n\n    this.hidden = false;\n\n\n\n    // create the frame\n\n    this.frame = document.createElement('div');\n\n    this.frame.className = 'vis-tooltip';\n\n    this.container.appendChild(this.frame);\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100082":{"id":"100082","x":"0","y":"80298","shape":"box","label":"  /**\n\n   * @param {number} x   Horizontal position of the popup window\n\n   * @param {number} y   Vertical position of the popup window\n\n   */\n\n  setPosition(x, y) {\n\n    this.x = parseInt(x);\n\n    this.y = parseInt(y);\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100083":{"id":"100083","x":"0","y":"80660","shape":"box","label":"  /**\n\n   * Set the content for the popup window. This can be HTML code or text.\n\n   * @param {string | Element} content\n\n   */\n\n  setText(content) {\n\n    if (content instanceof Element) {\n\n      this.frame.innerHTML = '';\n\n      this.frame.appendChild(content);\n\n    }\n\n    else {\n\n      this.frame.innerHTML = content; // string containing text or HTML\n\n    }\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100084":{"id":"100084","x":"0","y":"81834","shape":"box","label":"  /**\n\n   * Show the popup window\n\n   * @param {boolean} [doShow]    Show or hide the window\n\n   */\n\n  show(doShow) {\n\n    if (doShow === undefined) {\n\n      doShow = true;\n\n    }\n\n\n\n    if (doShow === true) {\n\n      var height = this.frame.clientHeight;\n\n      var width = this.frame.clientWidth;\n\n      var maxHeight = this.frame.parentNode.clientHeight;\n\n      var maxWidth = this.frame.parentNode.clientWidth;\n\n\n\n      var left = 0, top = 0;\n\n\n\n      if (this.overflowMethod == 'flip') {\n\n        var isLeft = false, isTop = true; // Where around the position it's located\n\n\n\n        if (this.y - height < this.padding) {\n\n          isTop = false;\n\n        }\n\n\n\n        if (this.x + width > maxWidth - this.padding) {\n\n          isLeft = true;\n\n        }\n\n\n\n        if (isLeft) {\n\n          left = this.x - width;\n\n        } else {\n\n          left = this.x;\n\n        }\n\n\n\n        if (isTop) {\n\n          top = this.y - height;\n\n        } else {\n\n          top = this.y;\n\n        }\n\n      } else {\n\n        top = (this.y - height);\n\n        if (top + height + this.padding > maxHeight) {\n\n          top = maxHeight - height - this.padding;\n\n        }\n\n        if (top < this.padding) {\n\n          top = this.padding;\n\n        }\n\n\n\n        left = this.x;\n\n        if (left + width + this.padding > maxWidth) {\n\n          left = maxWidth - width - this.padding;\n\n        }\n\n        if (left < this.padding) {\n\n          left = this.padding;\n\n        }\n\n      }\n\n\n\n      this.frame.style.left = left + \"px\";\n\n      this.frame.style.top = top + \"px\";\n\n      this.frame.style.visibility = \"visible\";\n\n      this.hidden = false;\n\n    }\n\n    else {\n\n      this.hide();\n\n    }\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100085":{"id":"100085","x":"0","y":"82952","shape":"box","label":"  /**\n\n   * Hide the popup window\n\n   */\n\n  hide() {\n\n    this.hidden = true;\n\n    this.frame.style.left = \"0\";\n\n    this.frame.style.top = \"0\";\n\n    this.frame.style.visibility = \"hidden\";\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100086":{"id":"100086","x":"0","y":"83258","shape":"box","label":"  /**\n\n   * Remove the popup window\n\n   */\n\n  destroy() {\n\n    this.frame.parentNode.removeChild(this.frame); // Remove element from DOM\n\n  }\n\n}\n\n\n\nexport default Popup;\n","font":{"align":"left","size":14}},
"100087":{"id":"100087","x":"0","y":"84484","shape":"box","label":"/home/mike/progr/soft/vis-network/lib/shared/Configurator.js","font":{"align":"left","size":200},"color":{"background":"red"}},
