"100119":{"id":"100119","x":"17000","y":"3618","shape":"box","label":"import moment from 'moment';\n\nimport pkg from '../package.json';\n\n\n\nconst header = `\n\n${ pkg.homepage }\n\n\n\n${ pkg.description }\n\n\n\n@version ${ pkg.version }\n\n@date    ${ moment().utc().format() }\n\n\n\n@copyright (c) 2011-2017 Almende B.V, http://almende.com\n\n@copyright (c) 2018-2019 visjs contributors, https://github.com/visjs\n\n\n\n@license \n\nvis.js is dual licensed under both\n\n\n\n  1. The Apache 2.0 License\n\n     http://www.apache.org/licenses/LICENSE-2.0\n\n\n\n  and\n\n\n\n  2. The MIT License\n\n     http://opensource.org/licenses/MIT\n\n\n\nvis.js may be distributed under either license.`;\n\n\n","font":{"align":"left","size":14}},
"100120":{"id":"100120","x":"17000","y":"4274","shape":"box","label":"/**\n\n * Generate a dynamic header banner.\n\n * \n\n * @param {String} component \n\n * @returns {String} banner\n\n */\n\nfunction genHeader(component) {\n\n   return '/**\\n' + [\n\n      pkg.name,\n\n      component ? ' - ' + component : '',\n\n      header\n\n   ].join('')\n\n   .replace(/^(?!\\n)/gm, ' * ')\n\n   .replace(/^(?=\\n)/gm, ' *') + '\\n */';\n\n}\n\n\n\nexport default genHeader;\n","font":{"align":"left","size":14}},
"100121":{"id":"100121","x":"17000","y":"5612","shape":"box","label":"/home/mike/progr/soft/vis-network/lib/network/typedefs.js","font":{"align":"left","size":200},"color":{"background":"red"}},
