"100433":{"id":"100433","x":"51000","y":"83294","shape":"box","label":"  /**\n\n   * @param {Object} options\n\n   * @param {Object} body\n\n   * @param {Label} labelModule\n\n   */\n\n  constructor(options, body, labelModule) {\n\n    super(options, body, labelModule);\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100434":{"id":"100434","x":"51000","y":"83684","shape":"box","label":"  /**\n\n   *\n\n   * @param {CanvasRenderingContext2D} ctx\n\n   * @param {boolean} [selected]\n\n   * @param {boolean} [hover]\n\n   */\n\n  resize(ctx, selected = this.selected, hover = this.hover) {\n\n    if (this.needsRefresh(selected, hover)) {\n\n      var dimensions = this.getDimensionsFromLabel(ctx, selected, hover);\n\n\n\n      this.height = dimensions.height * 2;\n\n      this.width  = dimensions.width + dimensions.height;\n\n      this.radius = 0.5*this.width;\n\n    }\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100435":{"id":"100435","x":"51000","y":"84256","shape":"box","label":"  /**\n\n   *\n\n   * @param {CanvasRenderingContext2D} ctx\n\n   * @param {number} x width\n\n   * @param {number} y height\n\n   * @param {boolean} selected\n\n   * @param {boolean} hover\n\n   * @param {ArrowOptions} values\n\n   */\n\n  draw(ctx, x, y, selected, hover, values) {\n\n    this.resize(ctx, selected, hover);\n\n    this.left = x - this.width * 0.5;\n\n    this.top = y - this.height * 0.5;\n\n\n\n    this.initContextForDraw(ctx, values);\n\n    ctx.ellipse_vis(this.left, this.top, this.width, this.height);\n\n    this.performFill(ctx, values);\n\n\n\n    this.updateBoundingBox(x, y, ctx, selected, hover);\n\n    this.labelModule.draw(ctx, x, y, selected, hover);\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100436":{"id":"100436","x":"51000","y":"84842","shape":"box","label":"  /**\n\n   *\n\n   * @param {CanvasRenderingContext2D} ctx\n\n   * @param {number} angle\n\n   * @returns {number}\n\n   */\n\n  distanceToBorder(ctx, angle) {\n\n    this.resize(ctx);\n\n    var a = this.width * 0.5;\n\n    var b = this.height * 0.5;\n\n    var w = (Math.sin(angle) * a);\n\n    var h = (Math.cos(angle) * b);\n\n    return a * b / Math.sqrt(w * w + h * h);\n\n  }\n\n}\n\n\n\nexport default Ellipse;\n","font":{"align":"left","size":14}},
