"100496":{"id":"100496","x":"68000","y":"21408","shape":"box","label":"/**\n\n * An icon replacement for the default Node shape.\n\n *\n\n * @extends NodeBase\n\n */\n\nclass Icon extends NodeBase {\n","font":{"align":"left","size":14}},
"100497":{"id":"100497","x":"68000","y":"21672","shape":"box","label":"  /**\n\n   * @param {Object} options\n\n   * @param {Object} body\n\n   * @param {Label} labelModule\n\n   */\n\n  constructor(options, body, labelModule) {\n\n    super(options, body, labelModule);\n\n    this._setMargins(labelModule);\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100498":{"id":"100498","x":"68000","y":"22104","shape":"box","label":"  /**\n\n   *\n\n   * @param {CanvasRenderingContext2D} ctx - Unused.\n\n   * @param {boolean} [selected]\n\n   * @param {boolean} [hover]\n\n   */\n\n  resize(ctx, selected, hover) {\n\n    if (this.needsRefresh(selected, hover)) {\n\n      this.iconSize = {\n\n        width: Number(this.options.icon.size),\n\n        height: Number(this.options.icon.size)\n\n      };\n\n      this.width = this.iconSize.width + this.margin.right + this.margin.left;\n\n      this.height = this.iconSize.height + this.margin.top + this.margin.bottom;\n\n      this.radius = 0.5*this.width;\n\n    }\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100499":{"id":"100499","x":"68000","y":"22760","shape":"box","label":"  /**\n\n   *\n\n   * @param {CanvasRenderingContext2D} ctx\n\n   * @param {number} x width\n\n   * @param {number} y height\n\n   * @param {boolean} selected\n\n   * @param {boolean} hover\n\n   * @param {ArrowOptions} values\n\n   */\n\n  draw(ctx, x, y, selected, hover, values) {\n\n    this.resize(ctx, selected, hover);\n\n    this.options.icon.size = this.options.icon.size || 50;\n\n\n\n    this.left = x - this.width / 2;\n\n    this.top  = y - this.height / 2;\n\n    this._icon(ctx, x, y, selected, hover, values);\n\n\n\n    if (this.options.label !== undefined) {\n\n      var iconTextSpacing = 5;\n\n      this.labelModule.draw(ctx, this.left + this.iconSize.width / 2 + this.margin.left,\n\n                                 y + this.height / 2 + iconTextSpacing, selected);\n\n    }\n\n\n\n    this.updateBoundingBox(x, y)\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100500":{"id":"100500","x":"68000","y":"23430","shape":"box","label":"  /**\n\n   *\n\n   * @param {number} x\n\n   * @param {number} y\n\n   */\n\n  updateBoundingBox(x, y) {\n\n    this.boundingBox.top    = y - this.options.icon.size * 0.5;\n\n    this.boundingBox.left   = x - this.options.icon.size * 0.5;\n\n    this.boundingBox.right  = x + this.options.icon.size * 0.5;\n\n    this.boundingBox.bottom = y + this.options.icon.size * 0.5;\n\n\n\n    if (this.options.label !== undefined && this.labelModule.size.width > 0) {\n\n      var iconTextSpacing = 5;\n\n      this.boundingBox.left = Math.min(this.boundingBox.left, this.labelModule.size.left);\n\n      this.boundingBox.right = Math.max(this.boundingBox.right, this.labelModule.size.left + this.labelModule.size.width);\n\n      this.boundingBox.bottom = Math.max(this.boundingBox.bottom, this.boundingBox.bottom + this.labelModule.size.height + iconTextSpacing);\n\n    }\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100501":{"id":"100501","x":"68000","y":"24352","shape":"box","label":"  /**\n\n   *\n\n   * @param {CanvasRenderingContext2D} ctx\n\n   * @param {number} x width\n\n   * @param {number} y height\n\n   * @param {boolean} selected\n\n   * @param {boolean} hover - Unused\n\n   * @param {ArrowOptions} values\n\n   */\n\n  _icon(ctx, x, y, selected, hover, values) {\n\n    let iconSize = Number(this.options.icon.size);\n\n\n\n    if (this.options.icon.code !== undefined) {\n\n      ctx.font = [\n\n        this.options.icon.weight != null\n\n          ? this.options.icon.weight\n\n          : selected\n\n          ? \"bold\"\n\n          : \"\",\n\n        // If the weight is forced (for example to make Font Awesome 5 work\n\n        // properly) substitute slightly bigger size for bold font face.\n\n        (this.options.icon.weight != null && selected ? 5 : 0) +\n\n          iconSize +\n\n          \"px\",\n\n        this.options.icon.face\n\n      ].join(\" \");\n\n\n\n      // draw icon\n\n      ctx.fillStyle = this.options.icon.color || \"black\";\n\n      ctx.textAlign = \"center\";\n\n      ctx.textBaseline = \"middle\";\n\n\n\n      // draw shadow if enabled\n\n      this.enableShadow(ctx, values);\n\n      ctx.fillText(this.options.icon.code, x, y);\n\n\n\n      // disable shadows for other elements.\n\n      this.disableShadow(ctx, values);\n\n    } else {\n\n      console.error('When using the icon shape, you need to define the code in the icon options object. This can be done per node or globally.')\n\n    }\n\n\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100502":{"id":"100502","x":"68000","y":"25176","shape":"box","label":"  /**\n\n   *\n\n   * @param {CanvasRenderingContext2D} ctx\n\n   * @param {number} angle\n\n   * @returns {number}\n\n   */\n\n  distanceToBorder(ctx, angle) {\n\n    return this._distanceToBorder(ctx,angle);\n\n  }\n\n}\n\n\n\nexport default Icon;\n","font":{"align":"left","size":14}},
