"100693":{"id":"100693","x":"85000","y":"70008","shape":"box","label":"/**\n\n * @extends BarnesHutSolver\n\n */\n\nclass ForceAtlas2BasedRepulsionSolver extends BarnesHutSolver {\n","font":{"align":"left","size":14}},
"100694":{"id":"100694","x":"85000","y":"70230","shape":"box","label":"  /**\n\n   * @param {Object} body\n\n   * @param {{physicsNodeIndices: Array, physicsEdgeIndices: Array, forces: {}, velocities: {}}} physicsBody\n\n   * @param {Object} options\n\n   */\n\n  constructor(body, physicsBody, options) {\n\n    super(body, physicsBody, options);\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100695":{"id":"100695","x":"85000","y":"70858","shape":"box","label":"  /**\n\n   * Calculate the forces based on the distance.\n\n   *\n\n   * @param {number} distance\n\n   * @param {number} dx\n\n   * @param {number} dy\n\n   * @param {Node} node\n\n   * @param {Object} parentBranch\n\n   * @private\n\n   */\n\n  _calculateForces(distance, dx, dy, node, parentBranch) {\n\n    if (distance === 0) {\n\n      distance = 0.1 * Math.random();\n\n      dx = distance;\n\n    }\n\n\n\n    if (this.overlapAvoidanceFactor < 1 && node.shape.radius) {\n\n      distance = Math.max(0.1 + (this.overlapAvoidanceFactor * node.shape.radius), distance - node.shape.radius);\n\n    }\n\n\n\n    let degree = (node.edges.length + 1);\n\n    // the dividing by the distance cubed instead of squared allows us to get the fx and fy components without sines and cosines\n\n    // it is shorthand for gravityforce with distance squared and fx = dx/distance * gravityForce\n\n    let gravityForce = this.options.gravitationalConstant * parentBranch.mass * node.options.mass * degree / Math.pow(distance,2);\n\n    let fx = dx * gravityForce;\n\n    let fy = dy * gravityForce;\n\n\n\n    this.physicsBody.forces[node.id].x += fx;\n\n    this.physicsBody.forces[node.id].y += fy;\n\n  }\n\n}\n\n\n\nexport default ForceAtlas2BasedRepulsionSolver;\n","font":{"align":"left","size":14}},
"100696":{"id":"100696","x":"85000","y":"72420","shape":"box","label":"/home/mike/progr/soft/vis-network/lib/network/modules/components/physics/CentralGravitySolver.js","font":{"align":"left","size":200},"color":{"background":"red"}},
