"100699":{"id":"100699","x":"85000","y":"74656","shape":"box","label":"/**\n\n * Central Gravity Solver\n\n */\n\nclass CentralGravitySolver {\n","font":{"align":"left","size":14}},
"100700":{"id":"100700","x":"85000","y":"74906","shape":"box","label":"  /**\n\n   * @param {Object} body\n\n   * @param {{physicsNodeIndices: Array, physicsEdgeIndices: Array, forces: {}, velocities: {}}} physicsBody\n\n   * @param {Object} options\n\n   */\n\n  constructor(body, physicsBody, options) {\n\n    this.body = body;\n\n    this.physicsBody = physicsBody;\n\n    this.setOptions(options);\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100701":{"id":"100701","x":"85000","y":"75212","shape":"box","label":"  /**\n\n   *\n\n   * @param {Object} options\n\n   */\n\n  setOptions(options) {\n\n    this.options = options;\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100702":{"id":"100702","x":"85000","y":"75644","shape":"box","label":"  /**\n\n   * Calculates forces for each node\n\n   */\n\n  solve() {\n\n    let dx, dy, distance, node;\n\n    let nodes = this.body.nodes;\n\n    let nodeIndices = this.physicsBody.physicsNodeIndices;\n\n    let forces = this.physicsBody.forces;\n\n\n\n    for (let i = 0; i < nodeIndices.length; i++) {\n\n      let nodeId = nodeIndices[i];\n\n      node = nodes[nodeId];\n\n      dx = -node.x;\n\n      dy = -node.y;\n\n      distance = Math.sqrt(dx * dx + dy * dy);\n\n\n\n      this._calculateForces(distance, dx, dy, forces, node);\n\n    }\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100703":{"id":"100703","x":"85000","y":"76216","shape":"box","label":"  /**\n\n   * Calculate the forces based on the distance.\n\n   * @param {number} distance\n\n   * @param {number} dx\n\n   * @param {number} dy\n\n   * @param {Object<Node.id, vis.Node>} forces\n\n   * @param {Node} node\n\n   * @private\n\n   */\n\n  _calculateForces(distance, dx, dy, forces, node) {\n\n    let gravityForce = (distance === 0) ? 0 : (this.options.centralGravity / distance);\n\n    forces[node.id].x = dx * gravityForce;\n\n    forces[node.id].y = dy * gravityForce;\n\n  }\n\n}\n\n\n\n\n\nexport default CentralGravitySolver;","font":{"align":"left","size":14}},
