"100708":{"id":"100708","x":"85000","y":"80096","shape":"box","label":"  /**\n\n   * @param {Object} body\n\n   * @param {{physicsNodeIndices: Array, physicsEdgeIndices: Array, forces: {}, velocities: {}}} physicsBody\n\n   * @param {Object} options\n\n   */\n\n  constructor(body, physicsBody, options) {\n\n    super(body, physicsBody, options);\n\n  }\n\n\n\n\n","font":{"align":"left","size":14}},
"100709":{"id":"100709","x":"85000","y":"80570","shape":"box","label":"  /**\n\n   * Calculate the forces based on the distance.\n\n   *\n\n   * @param {number} distance\n\n   * @param {number} dx\n\n   * @param {number} dy\n\n   * @param {Object<Node.id, Node>} forces\n\n   * @param {Node} node\n\n   * @private\n\n   */\n\n  _calculateForces(distance, dx, dy, forces, node) {\n\n    if (distance > 0) {\n\n      let degree = (node.edges.length + 1);\n\n      let gravityForce = this.options.centralGravity * degree * node.options.mass;\n\n      forces[node.id].x = dx * gravityForce;\n\n      forces[node.id].y = dy * gravityForce;\n\n    }\n\n  }\n\n}\n\n\n\nexport default ForceAtlas2BasedCentralGravitySolver;","font":{"align":"left","size":14}},
