"100981":{"id":"100981","x":"119000","y":"100412","shape":"box","label":"  /**\n\n   * Find the center position of the network considering the bounding boxes\n\n   *\n\n   * @param {Array.<Node>} allNodes\n\n   * @param {Array.<Node>} [specificNodes=[]]\n\n   * @returns {{minX: number, maxX: number, minY: number, maxY: number}}\n\n   * @static\n\n   */\n\n  static getRange(allNodes, specificNodes = []) {\n\n    var minY = 1e9, maxY = -1e9, minX = 1e9, maxX = -1e9, node;\n\n    if (specificNodes.length > 0) {\n\n      for (var i = 0; i < specificNodes.length; i++) {\n\n        node = allNodes[specificNodes[i]];\n\n        if (minX > node.shape.boundingBox.left) {\n\n          minX = node.shape.boundingBox.left;\n\n        }\n\n        if (maxX < node.shape.boundingBox.right) {\n\n          maxX = node.shape.boundingBox.right;\n\n        }\n\n        if (minY > node.shape.boundingBox.top) {\n\n          minY = node.shape.boundingBox.top;\n\n        } // top is negative, bottom is positive\n\n        if (maxY < node.shape.boundingBox.bottom) {\n\n          maxY = node.shape.boundingBox.bottom;\n\n        } // top is negative, bottom is positive\n\n      }\n\n    }\n\n\n\n    if (minX === 1e9 && maxX === -1e9 && minY === 1e9 && maxY === -1e9) {\n\n      minY = 0, maxY = 0, minX = 0, maxX = 0;\n\n    }\n\n    return {minX: minX, maxX: maxX, minY: minY, maxY: maxY};\n\n  }\n\n\n","font":{"align":"left","size":14}},
"100982":{"id":"100982","x":"119000","y":"101418","shape":"box","label":"  /**\n\n   * Find the center position of the network\n\n   *\n\n   * @param {Array.<Node>} allNodes\n\n   * @param {Array.<Node>} [specificNodes=[]]\n\n   * @returns {{minX: number, maxX: number, minY: number, maxY: number}}\n\n   * @static\n\n   */\n\n  static getRangeCore(allNodes, specificNodes = []) {\n\n    var minY = 1e9, maxY = -1e9, minX = 1e9, maxX = -1e9, node;\n\n    if (specificNodes.length > 0) {\n\n      for (var i = 0; i < specificNodes.length; i++) {\n\n        node = allNodes[specificNodes[i]];\n\n        if (minX > node.x) {\n\n          minX = node.x;\n\n        }\n\n        if (maxX < node.x) {\n\n          maxX = node.x;\n\n        }\n\n        if (minY > node.y) {\n\n          minY = node.y;\n\n        } // top is negative, bottom is positive\n\n        if (maxY < node.y) {\n\n          maxY = node.y;\n\n        } // top is negative, bottom is positive\n\n      }\n\n    }\n\n\n\n    if (minX === 1e9 && maxX === -1e9 && minY === 1e9 && maxY === -1e9) {\n\n      minY = 0, maxY = 0, minX = 0, maxX = 0;\n\n    }\n\n    return {minX: minX, maxX: maxX, minY: minY, maxY: maxY};\n\n  }\n\n\n\n\n","font":{"align":"left","size":14}},
"100983":{"id":"100983","x":"119000","y":"102102","shape":"box","label":"  /**\n\n   * @param {object} range = {minX: minX, maxX: maxX, minY: minY, maxY: maxY};\n\n   * @returns {{x: number, y: number}}\n\n   * @static\n\n   */\n\n  static findCenter(range) {\n\n    return {x: (0.5 * (range.maxX + range.minX)),\n\n      y: (0.5 * (range.maxY + range.minY))};\n\n  }\n\n\n\n\n","font":{"align":"left","size":14}},
"100984":{"id":"100984","x":"119000","y":"102632","shape":"box","label":"  /**\n\n   * This returns a clone of the options or options of the edge or node to be used for construction of new edges or check functions for new nodes.\n\n   * @param {vis.Item} item\n\n   * @param {'node'|undefined} type\n\n   * @returns {{}}\n\n   * @static\n\n   */\n\n  static cloneOptions(item, type) {\n\n    let clonedOptions = {};\n\n    if (type === undefined || type === 'node') {\n\n      util.deepExtend(clonedOptions, item.options, true);\n\n      clonedOptions.x = item.x;\n\n      clonedOptions.y = item.y;\n\n      clonedOptions.amountOfConnections = item.edges.length;\n\n    }\n\n    else {\n\n      util.deepExtend(clonedOptions, item.options, true);\n\n    }\n\n    return clonedOptions;\n\n  }\n\n\n\n}\n\n\n\nexport default NetworkUtil;","font":{"align":"left","size":14}},
