"101045":{"id":"101045","x":"136000","y":"74572","shape":"box","label":"var assert = require('assert'),\n\n    fs = require('fs'),\n\n    dot = require('../lib/network/dotparser.js');\n\n\n\ndescribe('dotparser', function () {\n\n\n\n  it('should parse a DOT file into JSON', function (done) {\n\n    fs.readFile('test/dot.txt', function (err, data) {\n\n      data = String(data);\n\n\n\n      var graph = dot.parseDOT(data);\n\n\n\n      assert.deepEqual(graph, {\n\n        \"type\": \"digraph\",\n\n        \"id\": \"test_graph\",\n\n        \"rankdir\": \"LR\",\n\n        \"size\": \"8,5\",\n\n        \"font\": \"arial\",\n\n        \"nodes\": [\n\n          {\n\n            \"id\": \"node1\",\n\n            \"attr\": {\n\n              \"shape\": \"doublecircle\"\n\n            }\n\n          },\n\n          {\n\n            \"id\": \"node2\",\n\n            \"attr\": {\n\n              \"shape\": \"doublecircle\"\n\n            }\n\n          },\n\n          {\n\n            \"id\": \"node3\",\n\n            \"attr\": {\n\n              \"shape\": \"doublecircle\"\n\n            }\n\n          },\n\n          {\n\n            \"id\": \"node4\",\n\n            \"attr\": {\n\n              \"shape\": \"diamond\",\n\n              \"color\": \"red\"\n\n            }\n\n          },\n\n          {\n\n            \"id\": \"node5\",\n\n            \"attr\": {\n\n              \"shape\": \"square\",\n\n              \"color\": \"blue\",\n\n              \"width\": 3\n\n            }\n\n          },\n\n          {\n\n            \"id\": 6,\n\n            \"attr\": {\n\n              \"shape\": \"circle\"\n\n            }\n\n          },\n\n          {\n\n            \"id\": \"A\",\n\n            \"attr\": {\n\n              \"shape\": \"circle\"\n\n            }\n\n          },\n\n          {\n\n            \"id\": \"B\",\n\n            \"attr\": {\n\n              \"shape\": \"circle\"\n\n            }\n\n          },\n\n          {\n\n            \"id\": \"C\",\n\n            \"attr\": {\n\n              \"shape\": \"circle\"\n\n            }\n\n          }\n\n        ],\n\n        \"edges\": [\n\n          {\n\n            \"from\": \"node1\",\n\n            \"to\": \"node1\",\n\n            \"type\": \"->\",\n\n            \"attr\": {\n\n              \"length\": 170,\n\n              \"fontSize\": 12,\n\n              \"label\": \"a\"\n\n            }\n\n          },\n\n          {\n\n            \"from\": \"node2\",\n\n            \"to\": \"node3\",\n\n            \"type\": \"->\",\n\n            \"attr\": {\n\n              \"length\": 170,\n\n              \"fontSize\": 12,\n\n              \"label\": \"b\"\n\n            }\n\n          },\n\n          {\n\n            \"from\": \"node1\",\n\n            \"to\": \"node4\",\n\n            \"type\": \"--\",\n\n            \"attr\": {\n\n              \"length\": 170,\n\n              \"fontSize\": 12,\n\n              \"label\": \"c\"\n\n            }\n\n          },\n\n          {\n\n            \"from\": \"node3\",\n\n            \"to\": \"node4\",\n\n            \"type\": \"->\",\n\n            \"attr\": {\n\n              \"length\": 170,\n\n              \"fontSize\": 12,\n\n              \"label\": \"d\"\n\n            }\n\n          },\n\n          {\n\n            \"from\": \"node4\",\n\n            \"to\": \"node5\",\n\n            \"type\": \"->\",\n\n            \"attr\": {\n\n              \"length\": 170,\n\n              \"fontSize\": 12\n\n            }\n\n          },\n\n          {\n\n            \"from\": \"node5\",\n\n            \"to\": 6,\n\n            \"type\": \"->\",\n\n            \"attr\": {\n\n              \"length\": 170,\n\n              \"fontSize\": 12\n\n            }\n\n          },\n\n          {\n\n            \"from\": \"A\",\n\n            \"to\": {\n\n              \"nodes\": [\n\n                {\n\n                  \"id\": \"B\",\n\n                  \"attr\": {\n\n                    \"shape\": \"circle\"\n\n                  }\n\n                },\n\n                {\n\n                  \"id\": \"C\",\n\n                  \"attr\": {\n\n                    \"shape\": \"circle\"\n\n                  }\n\n                }\n\n              ]\n\n            },\n\n            \"type\": \"->\",\n\n            \"attr\": {\n\n              \"length\": 170,\n\n              \"fontSize\": 12\n\n            }\n\n          }\n\n        ],\n\n        \"subgraphs\": [\n\n          {\n\n            \"nodes\": [\n\n              {\n\n                \"id\": \"B\",\n\n                \"attr\": {\n\n                  \"shape\": \"circle\"\n\n                }\n\n              },\n\n              {\n\n                \"id\": \"C\",\n\n                \"attr\": {\n\n                  \"shape\": \"circle\"\n\n                }\n\n              }\n\n            ]\n\n          }\n\n        ]\n\n      });\n\n\n\n      done();\n\n    });\n\n  });\n\n\n\n\n","font":{"align":"left","size":14}},
"101046":{"id":"101046","x":"136000","y":"78252","shape":"box","label":"  /**\n\n   * DOT-format examples taken from #3015\n\n   */\n\n  it('properly handles newline escape sequences in strings', function (done) {\n\n\t\tvar data = 'dinetwork {1 [label=\"new\\\\nline\"];}';\n\n\n\n    data = String(data);\n\n\n\n    var graph = dot.parseDOT(data);\n\n\n\n    assert.deepEqual(graph, {\n\n      \"id\": \"dinetwork\",\n\n      \"nodes\": [\n\n        {\n\n          \"id\": 1,\n\n          \"attr\": {\n\n            \"label\": \"new\\nline\",         // And not \"new\\\\nline\"\n\n          }\n\n        }\n\n      ]\n\n    });\n\n\n\n\n\n    // Note the double backslashes\n\n\t\tvar data2 = 'digraph {' + \"\\n\" +\n\n'\t3 [color=\"#0d2b7c\", label=\"query:1230:add_q\\\\n0.005283\\\\n6.83%\\\\n(0.0001)\\\\n(0.13%)\\\\n17×\"];' + \"\\n\" +\n\n'\t3 -> 7 [color=\"#0d2a7b\", fontcolor=\"#0d2a7b\", label=\"0.005128\\\\n6.63%\\\\n17×\"];' + \"\\n\" +\n\n'\t5 [color=\"#0d1976\", label=\"urlresolvers:537:reverse\\\\n0.00219\\\\n2.83%\\\\n(0.000193)\\\\n(0.25%)\\\\n29×\"];' + \"\\n\" +\n\n\"}\"\n\n\n\n    data2 = String(data2);\n\n\n\n    var graph2 = dot.parseDOT(data2);\n\n    //console.log(JSON.stringify(graph, null, 2));\n\n\n\n    assert.deepEqual(graph2, {\n\n      \"type\": \"digraph\",\n\n      \"nodes\": [\n\n        {\n\n          \"id\": 3,\n\n          \"attr\": {\n\n            \"color\": \"#0d2b7c\",\n\n            \"label\": \"query:1230:add_q\\n0.005283\\n6.83%\\n(0.0001)\\n(0.13%)\\n17×\"\n\n          }\n\n        },\n\n        {\n\n          \"id\": 7\n\n        },\n\n        {\n\n          \"id\": 5,\n\n          \"attr\": {\n\n            \"color\": \"#0d1976\",\n\n            \"label\": \"urlresolvers:537:reverse\\n0.00219\\n2.83%\\n(0.000193)\\n(0.25%)\\n29×\"\n\n          }\n\n        }\n\n      ],\n\n      \"edges\": [\n\n        {\n\n          \"from\": 3,\n\n          \"to\": 7,\n\n          \"type\": \"->\",\n\n          \"attr\": {\n\n            \"color\": \"#0d2a7b\",\n\n            \"fontcolor\": \"#0d2a7b\",\n\n            \"label\": \"0.005128\\n6.63%\\n17×\"\n\n          }\n\n        }\n\n      ]\n\n    });\n\n\n\n    done();\n\n  });\n\n\n\n});\n","font":{"align":"left","size":14}},
