"101119":{"id":"101119","x":"153000","y":"233848","shape":"box","label":"  /**\n\n   * Convert HSV <0, 1> into RGB color object.\n\n   * https://gist.github.com/mjijackson/5311256\n\n   *\n\n   * @param h - Hue\n\n   * @param s - Saturation\n\n   * @param v - Value\n\n   *\n\n   * @returns RGB color object.\n\n   */\n\n\n\n\n\n  function HSVToRGB(h, s, v) {\n\n    var r;\n\n    var g;\n\n    var b;\n\n    var i = Math.floor(h * 6);\n\n    var f = h * 6 - i;\n\n    var p = v * (1 - s);\n\n    var q = v * (1 - f * s);\n\n    var t = v * (1 - (1 - f) * s);\n\n\n\n    switch (i % 6) {\n\n      case 0:\n\n        r = v, g = t, b = p;\n\n        break;\n\n\n\n      case 1:\n\n        r = q, g = v, b = p;\n\n        break;\n\n\n\n      case 2:\n\n        r = p, g = v, b = t;\n\n        break;\n\n\n\n      case 3:\n\n        r = p, g = q, b = v;\n\n        break;\n\n\n\n      case 4:\n\n        r = t, g = p, b = v;\n\n        break;\n\n\n\n      case 5:\n\n        r = v, g = p, b = q;\n\n        break;\n\n    }\n\n\n\n    return {\n\n      r: Math.floor(r * 255),\n\n      g: Math.floor(g * 255),\n\n      b: Math.floor(b * 255)\n\n    };\n\n  }\n","font":{"align":"left","size":14}},
"101120":{"id":"101120","x":"153000","y":"234854","shape":"box","label":"  /**\n\n   * Convert HSV <0, 1> into hex color string.\n\n   *\n\n   * @param h - Hue\n\n   * @param s - Saturation\n\n   * @param v - Value\n\n   *\n\n   * @returns Hex color string.\n\n   */\n\n\n\n\n\n  function HSVToHex(h, s, v) {\n\n    var rgb = HSVToRGB(h, s, v);\n\n    return RGBToHex(rgb.r, rgb.g, rgb.b);\n\n  }\n","font":{"align":"left","size":14}},
