"101432":{"id":"101432","x":"153000","y":"690658","shape":"box","label":"      /**\n\n       * Get the current dimensions of the label\n\n       *\n\n       * @return {rect}\n\n       */\n\n\n\n    }, {\n\n      key: \"getSize\",\n\n      value: function getSize() {\n\n        var lineMargin = 2;\n\n        var x = this.size.left; // default values which might be overridden below\n\n\n\n        var y = this.size.top - 0.5 * lineMargin; // idem\n\n\n\n        if (this.isEdgeLabel) {\n\n          var x2 = -this.size.width * 0.5;\n\n\n\n          switch (this.fontOptions.align) {\n\n            case 'middle':\n\n              x = x2;\n\n              y = -this.size.height * 0.5;\n\n              break;\n\n\n\n            case 'top':\n\n              x = x2;\n\n              y = -(this.size.height + lineMargin);\n\n              break;\n\n\n\n            case 'bottom':\n\n              x = x2;\n\n              y = lineMargin;\n\n              break;\n\n          }\n\n        }\n\n\n\n        var ret = {\n\n          left: x,\n\n          top: y,\n\n          width: this.size.width,\n\n          height: this.size.height\n\n        };\n\n        return ret;\n\n      }\n","font":{"align":"left","size":14}},
