"101559":{"id":"101559","x":"153000","y":"770610","shape":"box","label":"    /**\n\n     * Attach a edge to the node\n\n     * @param {Edge} edge\n\n     */\n\n\n\n\n\n    createClass$1(Node, [{\n\n      key: \"attachEdge\",\n\n      value: function attachEdge(edge) {\n\n        if (this.edges.indexOf(edge) === -1) {\n\n          this.edges.push(edge);\n\n        }\n\n      }\n","font":{"align":"left","size":14}},
