"102076":{"id":"102076","x":"153000","y":"1281318","shape":"box","label":"      /**\n\n       * Set the color of the colorPicker\n\n       * Supported formats:\n\n       * 'red'                   --> HTML color string\n\n       * '#ffffff'               --> hex string\n\n       * 'rgb(255,255,255)'      --> rgb string\n\n       * 'rgba(255,255,255,1.0)' --> rgba string\n\n       * {r:255,g:255,b:255}     --> rgb object\n\n       * {r:255,g:255,b:255,a:1.0} --> rgba object\n\n       * @param {string|Object} color\n\n       * @param {boolean} [setInitial=true]\n\n       */\n\n\n\n    }, {\n\n      key: \"setColor\",\n\n      value: function setColor(color) {\n\n        var setInitial = arguments.length > 1 && arguments[1] !== undefined ? arguments[1] : true;\n\n\n\n        if (color === 'none') {\n\n          return;\n\n        }\n\n\n\n        var rgba; // if a html color shorthand is used, convert to hex\n\n\n\n        var htmlColor = this._isColorString(color);\n\n\n\n        if (htmlColor !== undefined) {\n\n          color = htmlColor;\n\n        } // check format\n\n\n\n\n\n        if (util.isString(color) === true) {\n\n          if (util.isValidRGB(color) === true) {\n\n            var rgbaArray = color.substr(4).substr(0, color.length - 5).split(',');\n\n            rgba = {\n\n              r: rgbaArray[0],\n\n              g: rgbaArray[1],\n\n              b: rgbaArray[2],\n\n              a: 1.0\n\n            };\n\n          } else if (util.isValidRGBA(color) === true) {\n\n            var _rgbaArray = color.substr(5).substr(0, color.length - 6).split(',');\n\n\n\n            rgba = {\n\n              r: _rgbaArray[0],\n\n              g: _rgbaArray[1],\n\n              b: _rgbaArray[2],\n\n              a: _rgbaArray[3]\n\n            };\n\n          } else if (util.isValidHex(color) === true) {\n\n            var rgbObj = util.hexToRGB(color);\n\n            rgba = {\n\n              r: rgbObj.r,\n\n              g: rgbObj.g,\n\n              b: rgbObj.b,\n\n              a: 1.0\n\n            };\n\n          }\n\n        } else {\n\n          if (color instanceof Object) {\n\n            if (color.r !== undefined && color.g !== undefined && color.b !== undefined) {\n\n              var alpha = color.a !== undefined ? color.a : '1.0';\n\n              rgba = {\n\n                r: color.r,\n\n                g: color.g,\n\n                b: color.b,\n\n                a: alpha\n\n              };\n\n            }\n\n          }\n\n        } // set color\n\n\n\n\n\n        if (rgba === undefined) {\n\n          throw new Error(\"Unknown color passed to the colorPicker. Supported are strings: rgb, hex, rgba. Object: rgb ({r:r,g:g,b:b,[a:a]}). Supplied: \" + JSON.stringify(color));\n\n        } else {\n\n          this._setColor(rgba, setInitial);\n\n        }\n\n      }\n","font":{"align":"left","size":14}},
