"102139":{"id":"102139","x":"153000","y":"1384428","shape":"box","label":"  /**\n\n   * Cleans up all bindings of the network, removing it fully from the memory IF the variable is set to null after calling this function.\n\n   * var network = new vis.Network(..);\n\n   * network.destroy();\n\n   * network = null;\n\n   */\n\n\n\n\n\n  Network.prototype.destroy = function () {\n\n    this.body.emitter.emit(\"destroy\"); // clear events\n\n\n\n    this.body.emitter.off();\n\n    this.off(); // delete modules\n\n\n\n    delete this.groups;\n\n    delete this.canvas;\n\n    delete this.selectionHandler;\n\n    delete this.interactionHandler;\n\n    delete this.view;\n\n    delete this.renderer;\n\n    delete this.physics;\n\n    delete this.layoutEngine;\n\n    delete this.clustering;\n\n    delete this.manipulation;\n\n    delete this.nodesHandler;\n\n    delete this.edgesHandler;\n\n    delete this.configurator;\n\n    delete this.images;\n\n\n\n    for (var nodeId in this.body.nodes) {\n\n      if (!this.body.nodes.hasOwnProperty(nodeId)) continue;\n\n      delete this.body.nodes[nodeId];\n\n    }\n\n\n\n    for (var edgeId in this.body.edges) {\n\n      if (!this.body.edges.hasOwnProperty(edgeId)) continue;\n\n      delete this.body.edges[edgeId];\n\n    } // remove the container and everything inside it recursively\n\n\n\n\n\n    util.recursiveDOMDelete(this.body.container);\n\n  };\n","font":{"align":"left","size":14}},
"102140":{"id":"102140","x":"153000","y":"1385588","shape":"box","label":"  /**\n\n   * Update the values of all object in the given array according to the current\n\n   * value range of the objects in the array.\n\n   * @param {Object} obj    An object containing a set of Edges or Nodes\n\n   *                        The objects must have a method getValue() and\n\n   *                        setValueRange(min, max).\n\n   * @private\n\n   */\n\n\n\n\n\n  Network.prototype._updateValueRange = function (obj) {\n\n    var id; // determine the range of the objects\n\n\n\n    var valueMin = undefined;\n\n    var valueMax = undefined;\n\n    var valueTotal = 0;\n\n\n\n    for (id in obj) {\n\n      if (obj.hasOwnProperty(id)) {\n\n        var value = obj[id].getValue();\n\n\n\n        if (value !== undefined) {\n\n          valueMin = valueMin === undefined ? value : Math.min(value, valueMin);\n\n          valueMax = valueMax === undefined ? value : Math.max(value, valueMax);\n\n          valueTotal += value;\n\n        }\n\n      }\n\n    } // adjust the range of all objects\n\n\n\n\n\n    if (valueMin !== undefined && valueMax !== undefined) {\n\n      for (id in obj) {\n\n        if (obj.hasOwnProperty(id)) {\n\n          obj[id].setValueRange(valueMin, valueMax, valueTotal);\n\n        }\n\n      }\n\n    }\n\n  };\n","font":{"align":"left","size":14}},
